<?php

declare(strict_types=1);

namespace Tests\VatsimClient;

use GuzzleHttp\Client as GuzzleClient;
use Mockery;
use Mockery\Adapter\Phpunit\MockeryTestCase;
use PHPUnit\Framework\Attributes\CoversClass;
use Psr\Http\Message\ResponseInterface;
use Vatradar\Dataobjects\Vatsim\VatsimData;
use Vatradar\Vatsimclient\Client as VatsimClient;

#[CoversClass(VatsimClient::class)]
class ClientTest extends MockeryTestCase
{
    protected string $bootstrapUri = 'https://status.vatsim.net/status.json';
    protected string $dataUri = 'https://data.vatsim.net/v3/vatsim-data.json';

    public function testBootstrap(): void
    {
        $guzzle = $this->mockGuzzle(true);

        $client = new VatsimClient($guzzle, ['bootUri' => $this->bootstrapUri, 'version' => 'v3']);
        $client->bootstrap();
        
        $this->assertEquals($this->dataUri, $client->getOption('dataUri'));
    }

    /**
     * @dataProvider retrieveDataProvider
     */
    public function testRetrieve(bool $raw, mixed $expected): void
    {
        $guzzle = $this->mockGuzzle(false);

        $client = new VatsimClient($guzzle, ['bootUri' => $this->bootstrapUri, 'version' => 'v3', 'dataUri' => $this->dataUri]);

        $result = $client->retrieve($raw);
        if ($raw) {
            $this->assertIsString($result);
        } else {
            $this->assertInstanceOf($expected, $result);
        }
    }

    public static function retrieveDataProvider(): array
    {
        return [
            ['raw' => false, 'expected' => VatsimData::class],
            ['raw' => true, 'expected' => 'string'],
        ];
    }

    protected function mockGuzzle(bool $bootstrap = false): GuzzleClient
    {
        $gResponse = Mockery::mock(ResponseInterface::class)
            ->allows(['getBody' => $this->vsResponseProvider($bootstrap)]);

        $guzzle = Mockery::mock(GuzzleClient::class);
        $guzzle->allows(['request' => $gResponse]);

        return $guzzle;
    }

